var tpxColor = cpw_idx[query];

if (tpxColor != null) {
    var cpwElement = document.getElementById('cpw' + tpxColor);

    content.style.backgroundColor = cpw_rgb[tpxColor];
    cpwElement.className = cpwElement.className + " colorPaletteWidget_selected";

    var scrollElement = document.getElementById('colorPaletteWidget_palette');
    var scrollPosition = cpwElement.offsetLeft - (window.innerWidth - cpwElement.offsetWidth) / 2;
    scrollElement.scrollLeft = scrollPosition;
}

function colorPaletteWidget_click(colorElement) {
    var id = colorElement.id.substring(3);
    queryText.value = cpw_name[id];
    queryForm.submit();
}

function colorPaletteWidget_contextmenu(colorElement) {
    var id = colorElement.id.substring(3);
    content.style.backgroundColor = cpw_rgb[id];
}


var colors = document.getElementsByClassName('colorPaletteWidget_color');
for (var i = 0; i < colors.length; ++i) {
  colors[i].onclick = function (){colorPaletteWidget_click(this)};
  colors[i].oncontextmenu = function (){colorPaletteWidget_contextmenu(this);return false;};
}

